					["custom"] = "if aura_env.state.valid then\n    if aura_env.show_GLOW and aura_env.state.frame then\n        aura_env.Glow(aura_env.state.frame, true)\n    end\n    \n    if aura_env.state.targeted and aura_env.show_BIGICON then \n        WeakAuras.ScanEvents(\n            \"SHOW_BIGICON\",\n            aura_env.state.icon,\n            aura_env.state.spellId,\n            aura_env.state.duration\n        )\n    end\nend\n\n\n\n\n\n",
					["glow_action"] = "show",
					["do_sound"] = false,
					["do_custom"] = false,
					["sound"] = " custom",
				},
				["finish"] = {
					["custom"] = "local env = aura_env\nif env.config.glowShow and env.state.frame and env.state.spellInList then\n    env.Glow(env.state.frame, false)\nend\n\nif env.state.targeted and env.show_BIGICON then\n    WeakAuras.ScanEvents(\n        \"HIDE_BIGICON\",\n        env.state.spellId\n    )\nend\n\n-- fix \"ghosts\" casts\nfor sourceGUID in pairs(env.state.casts) do\n    if env.allcasts[sourceGUID] then\n        if env.allcasts[sourceGUID].nameplate then\n            env.removeFontFromNameplate(env.allcasts[sourceGUID].nameplate)\n        end\n        env.allcasts[sourceGUID] = nil\n    end\nend",
					["do_custom"] = true,
				},
				["init"] = {
					["custom"] = "-- update 02/02/09 -- by Buds - https://wago.io/BFADungeonTargetedSpells\n\n-- Spell list\naura_env.spells = { \n    -- [spellId] = important (true or false),\n    [259832] = true,\n    \n    [288693] = false, -- Tormented Soul - Grave Bolt (Reaping affix)\n    \n    -- Atal'Dazar\n    [253239] = false, -- Dazar'ai Juggernaut - Merciless Assault\n    [256846] = false, -- Dinomancer Kish'o - Deadeye Aim\n    [257407] = true, -- Rezan - Pursuit\n    \n    -- Freehold\n    [272402] = true, -- Cutwater Knife Juggler - Ricocheting Throw\n    [257739] = true, -- Blacktooth Scrapper - Blind Rage\n    [258338] = true, -- Captain Raoul - Blackout Barrel\n    [256979] = true, -- Captain Eudora - Powder Shot\n    \n    -- Kings'Rest\n    [270507] = true, --  Spectral Beastmaster - Poison Barrage\n    [265773] = true, -- The Golden Serpent - Spit Gold\n    [270506] = true, -- Spectral Beastmaster - Deadeye Shot\n    \n    -- Shrine of the Storm\n    [264166] = true, -- Aqu'sirr - Undertow\n    [268214] = true, -- Runecarver Sorn - Carve Flesh\n    \n    -- Siege of Boralus\n    [257641] = false, -- Kul Tiran Marksman - Molten Slug\n    [257036] = true, -- Dockhound Packmaster - Feral Charge\n    [272662] = false, -- Irontide Raider - Iron Hook\n    [256639] = false, -- Blacktar Bomber - Fire Bomb\n    [272874] = true, -- Ashvane Commander - Trample\n    [272581] = false, -- Bilge Rat Tempest - Water Spray\n    [272528] = false, -- Ashvane Sniper - Shoot\n    [272542] = true, -- Ashvane Sniper - Ricochet\n    \n    -- Temple of Sethraliss\n    [268703] = false, -- Charged Dust Devil - Lightning Bolt\n    [272670] = false, -- Sandswept Marksman - Shoot\n    [267278] = false, -- Static-charged Dervish - Electrocute\n    [272820] = false, -- Spark Channeler - Shock\n    [274642] = false, -- Hoodoo Hexer - Lava Burst\n    [268061] = false, -- Plague Doctor - Chain Lightning\n    \n    -- The Motherlode!!\n    [268185] = true, -- Refreshment Vendor, Iced Spritzer\n    [258674] = false, -- Off-Duty Laborer - Throw Wrench\n    [276304] = false, -- Rowdy Reveler - Penny For Your Thoughts\n    [263628] = true, -- Mechanized Peacekeeper - Charged Claw\n    [263209] = false, -- Mine Rat - Throw Rock\n    [268797] = false, -- Venture Co. Alchemist - Transmute: Enemy to Goo\n    [263202] = false, -- Venture Co. Earthshaper - Rock Lance\n    [262794] = false, -- Venture Co. Mastermind - Energy Lash\n    [260669] = true, -- Rixxa Fluxflame - Propellant Blast\n    \n    -- The Underrot\n    [265376] = true, -- Fanatical Headhunter - Barbed Spear\n    [265084] = false, -- Devout Blood Priest - Blood Bolt\n    [265625] = true, -- Befouled Spirit - Dark Omen\n    \n    -- Tol Dagor\n    [256039] = true, -- Overseer Korgus - Deadeye\n    [185857] = false, -- Ashvane Spotter - Shoot\n    \n    -- Waycrest Manor\n    [263891] = false, -- Heartsbane Vinetwister - Grasping Thorns\n    [264510] = false, -- Crazed Marksman - Shoot\n    [260699] = false, -- Coven Diviner - Soul Bolt\n    [260551] = true, -- Soulbound Goliath - Soul Thorns\n    [260741] = true, -- Heartsbane Triad - Jagged Nettles\n    [268202] = true, -- Gorak Tul - Death Lens\n}\n\naura_env.blacklist_npc = {\n    [120651] = true, -- explosive orb affix\n}\naura_env.blacklist_spell = {\n    \n}\n\n-- DO NOT EDIT BELOW --\n\naura_env.loaded = false\n\naura_env.position = {\"LEFT\",\"TOPLEFT\",\"TOP\",\"TOPRIGHT\",\"RIGHT\",\"BOTTOMRIGHT\",\"BOTTOM\",\"BOTTOMLEFT\",\"CENTER\"}\naura_env.direction = {\"LEFT\",\"RIGHT\",\"TOP\",\"BOTTOM\",\"HORIZONTAL\",\"VERTICAL\"}\n\naura_env.isBlackListed = function(spellId, unit)\n    local guid = UnitGUID(unit)\n    local npc_id= select(6,strsplit(\"-\",guid))\n    return aura_env.blacklist_spell[spellId] or aura_env.blacklist_npc[npc_id]\nend\n\naura_env.allcasts = {}\n\nif select(4, GetAddOnInfo(\"LibGetFrame-1.0\")) then\n    aura_env.GetFrame = LibStub(\"LibGetFrame-1.0\").GetFrame\nelse\n    WeakAuras.prettyPrint((\"'%s' requires LibGetFrame-1.0 get it at https://www.curseforge.com/wow/addons/libgetframe\"):format(aura_env.id))\n    return\nend\n\n-- Custom Glow\n\nlocal LCG = LibStub(\"LibCustomGlow-1.0\")\nlocal glowTypes = {\"Standard\", \"Pixel\", \"AutoCast\"}\n\nlocal glowFunc\nif type(budsCleanFrames) ~= \"table\" then\n    budsCleanFrames = {}\n    local cleaner = function()\n        if not InCombatLockdown() then\n            for auraid, frames in pairs(budsCleanFrames) do\n                for frame, glowType in pairs(frames) do\n                    glowFunc(frame, false, auraid, glowType)\n                end\n            end\n        end\n    end\n    -- hide glow on opening WeakAurasOptions\n    hooksecurefunc(WeakAuras, \"OpenOptions\", cleaner)\nend\nif type(budsCleanFrames[aura_env.id]) ~= \"table\" then\n    budsCleanFrames[aura_env.id] = {} \nend\n\nglowFunc = function(frame, show, id, glowType)\n    if frame then\n        id = id or aura_env.id\n        glowType = glowType or glowTypes[aura_env.config.glowType]\n        if show then\n            budsCleanFrames[id][frame] = glowType\n            if glowType == \"AutoCast\" then\n                LCG.AutoCastGlow_Start(\n                    frame,\n                    aura_env.config.glowColor,\n                    aura_env.config.glowParticules,\n                    aura_env.config.glowFrequency,\n                    aura_env.config.glowScale,\n                    aura_env.config.glowxOffset,\n                    aura_env.config.glowyOffset,\n                    id\n                )\n            elseif glowType == \"Pixel\" then\n                LCG.PixelGlow_Start(\n                    frame,\n                    aura_env.config.glowColor,\n                    aura_env.config.glowParticules,\n                    aura_env.config.glowFrequency,\n                    aura_env.config.glowLength,\n                    aura_env.config.glowThickness,\n                    aura_env.config.glowxOffset,\n                    aura_env.config.glowyOffset,\n                    aura_env.config.glowBorder,\n                    id\n                )\n            elseif glowType == \"Standard\" then\n                LCG.ButtonGlow_Start(frame)\n            end\n        else\n            budsCleanFrames[id][frame] = nil\n            if glowType == \"AutoCast\" then\n                LCG.AutoCastGlow_Stop(frame, id)\n            elseif glowType == \"Pixel\" then\n                LCG.PixelGlow_Stop(frame, id)\n            elseif glowType == \"Standard\" then\n                LCG.ButtonGlow_Stop(frame)\n            end\n        end\n    end\nend\n\naura_env.Glow = glowFunc\n\n\n\n-- Nameplates\nlocal fonts = {}\n\naura_env.addFontToNameplate = function(unit, target)\n    local nameplate = C_NamePlate.GetNamePlateForUnit(unit)\n    if nameplate then\n        local nameplateUnit = nameplate.namePlateUnitToken or nameplate.unitFrame and nameplate.unitFrame.unit\n        if nameplateUnit then\n            if not fonts[nameplateUnit] then\n                fonts[nameplateUnit] = UIParent:CreateFontString(nil, \"OVERLAY\")\n                fonts[nameplateUnit]:SetFont(aura_env.region.text2:GetFont() or \"Fonts\\\\2002.TTF\", 20, \"OUTLINE\")\n            end\n            local font = fonts[nameplateUnit]\n            font:SetPoint(\"CENTER\", nameplate, \"CENTER\", aura_env.config.nameplatexOffset, aura_env.config.nameplateyOffset)\n            font:SetText(WA_ClassColorName(target))\n            font:Show()\n            return nameplateUnit\n        end\n    end\n    return true\nend\n\naura_env.removeFontFromNameplate = function(unit)\n    local font = fonts[unit]\n    if font then\n        font:Hide()\n    end\nend\n\n\naura_env.loaded = true",
					["do_custom"] = true,
				},
