			["text1FontSize"] = 13,
			["cooldownTextEnabled"] = true,
			["customText"] = "function()\n    aura_env.timer = aura_env.timer or 0\n    if GetTime() >= aura_env.timer then\n        aura_env.timer = GetTime()+0.2\n        aura_env.result = \"\"\n        if aura_env.state then\n            if aura_env.state.expirationTime then\n                local timeleft = aura_env.round(aura_env.state.expirationTime-GetTime(),0)\n                if timeleft <= 7 then\n                    for unit in WA_IterateGroupMembers() do\n                        if aura_env.range(unit) <= 5 and UnitName(unit) ~= UnitName(\"player\") and not UnitIsDead(unit) then\n                            local unitC = WA_ClassColorName(unit)\n                            aura_env.result = aura_env.result..unitC..\"\\n\"\n                        end\n                    end\n                end\n            end\n        end\n    end\n    return aura_env.result\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["yOffset"] = 0,
