			["displayText"] = "%c",
			["customText"] = "function()\n    local display = \"\"\n    local function RGBPercToHex(r, g, b)\n        r = r <= 1 and r >= 0 and r or 0\n        g = g <= 1 and g >= 0 and g or 0\n        b = b <= 1 and b >= 0 and b or 0\n        return string.format(\"%02x%02x%02x\", r*255, g*255, b*255)\n    end\n    for i = 1, 20 do\n        local unit = 'raid'..i\n        if (UnitExists(unit) and UnitPower(unit) and UnitPower(unit) > 0) then\n            local role = UnitGroupRolesAssigned(unit);\n            if (role == \"HEALER\") then \n                local classFileName = select(2, UnitClass(unit))\n                local color = RAID_CLASS_COLORS[classFileName]\n                if (not color) then return end\n                local hex = RGBPercToHex(color.r, color.g, color.b)\n                local power = math.floor((UnitPower(unit) / UnitPowerMax(unit)) * 100)\n                display = display..\"|cFF\"..hex..UnitName(unit)..\"|r: \"..power..\"\\n\"\n            end\n        end\n    end \n    return display\nend",
