						["customName"] = "function()\n    -- add comma to separate thousands\n    -- \n    local function comma_value(amount)\n        local formatted = amount\n        while true do  \n            formatted, k = string.gsub(formatted, \"^(-?%d+)(%d%d%d)\", '%1,%2')\n            if (k==0) then\n                break\n            end\n        end\n        return formatted\n    end\n    \n    return string.format(\"Roots\\n  Current: \"..comma_value(math.floor(CBT_Total))..\"\\n  Last: \"..comma_value(math.floor(CBT_Reset)))\nend",
						["spellIds"] = {
						},
						["custom"] = "-- This is not a perfect simulation\n-- The roots ticks this WA will simulate will be off timing to the real roots\n-- There is no way to sync them\n-- That means sometimes there will be 1 extra or 1 missing tick being calculated\n-- Nisekoi\n-- any questions at dab#2496 EU\n\n\nfunction() \n    \n    if(UnitBuff(\"Player\", \"Cloudburst Totem\") or UnitBuff(\"Player\", \"Ancestral Guidance\") or UnitBuff(\"Player\", \"Velen's Future Sight\")) then\n        if (GetUnitSpeed(\"player\") == 0)then\n            if (CBT_WasMoving == true) then\n                CBT_WasMoving = false\n                CBT_GoTime = GetTime() + 1      \n            end\n            \n            \n            if(CBT_GoTime <= GetTime()) then\n                if(UnitBuff(\"Player\", \"Cloudburst Totem\") and UnitBuff(\"Player\", \"Ancestral Guidance\")) then\n                    CBT_Total = CBT_Total + (UnitHealthMax(\"player\")*0.012); \n                    --roots into ag into cbt + roots into cbt\n                elseif(UnitBuff(\"Player\", \"Cloudburst Totem\") and not UnitBuff(\"Player\", \"Ancestral Guidance\"))  then\n                    CBT_Total = CBT_Total + (UnitHealthMax(\"player\")*0.0075);\n                    --only roots into cbt\n                end\n                if(UnitBuff(\"Player\", \"Ancestral Guidance\")) then\n                    CBT_Total = CBT_Total + (UnitHealthMax(\"player\")*0.018);\n                end\n                if(UnitBuff(\"Player\", \"Velen's Future Sight\")) then\n                    if(UnitHealthMax(\"player\") == UnitHealth(\"player\")) then\n                        CBT_Total = CBT_Total + (UnitHealthMax(\"player\")*0.015);\n                    end\n                end\n                CBT_GoTime = GetTime() + 1\n            end\n            \n        else\n            if (GetUnitSpeed(\"player\") ~= 0) then\n                CBT_WasMoving = true\n            end\n        end\n    end\n    \n    \n    --Buff Water Walking and click it away to reset the Total\n    if(UnitBuff(\"Player\", \"Water Walking\")) then\n        if(CBT_Total ~= 0) then\n            CBT_Reset = CBT_Total\n            CBT_Total = 0\n        end\n    end\n    \n    return true\nend\n\n\n\n",
