		["01-Cudgle of Gore"] = {
			["text2Point"] = "CENTER",
			["text1FontSize"] = 13,
			["cooldownTextEnabled"] = true,
			["customText"] = "function()\n    aura_env.time = aura_env.time or 0\n    if GetTime() >= aura_env.time+0.3 then\n        aura_env.result = \"\"\n        aura_env.time = GetTime()\n        \n        local count = 0\n        local result = \"\"\n        local distance = 0\n        local color = \"|cFFFF0000\"\n        if UnitExists(\"boss1\") then\n            local name = UnitName(\"boss1target\")\n            if name == UnitName(\"player\") then\n                aura_env.result = \"run out\"\n            else\n                distance = rangecheck(name)\n                \n                \n                if distance >= 43 then\n                    color = \"|cFF00FF00\"\n                elseif distance >= 30 then \n                    color = \"|cFFFFFF00\"\n                    \n                elseif distance >= 22 then \n                    color = \"|cFFFFA500\"\n                else\n                    color = \"|cFFFF0000\"\n                end\n                result = \"Distance: \\n\"..color..\"<\"..distance..\" yards\"\n                aura_env.result = result\n            end\n        end\n    end\n    return aura_env.result\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["text2"] = "%p",
			["cooldownSwipe"] = true,
			["cooldownEdge"] = false,
			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/ByyBK8vpG/33",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "aura_env.result = \"\"\n\nfunction rangecheck(uId)\n    local range = 0\n    if IsItemInRange(37727, uId) then range = 5--Ruby Acorn\n    elseif IsItemInRange(63427, uId) then range = 8--Worgsaw\n    elseif CheckInteractDistance(uId, 3) then range = 10\n    elseif CheckInteractDistance(uId, 2) then range = 11\n    elseif IsItemInRange(32321, uId) then range = 13--reports 12 but actual range tested is 13\n    elseif IsItemInRange(6450, uId) then range = 18--Bandages. (despite popular sites saying it's 15 yards, it's actually 18 yards verified even by UnitDistanceSquared\n    elseif IsItemInRange(21519, uId) then range = 22--Item says 20, returns true until 22.\n    elseif CheckInteractDistance(uId, 1) then range = 30\n    elseif UnitInRange(uId) then range = 43\n    elseif IsItemInRange(116139, uId)  then range = 50\n    elseif IsItemInRange(32825, uId) then range = 60\n    elseif IsItemInRange(35278, uId) then range = 80\n    else range = 1000 end--Just so it has a numeric value, even if it's unknown to protect from nil errors\n    return range\nend \n\n",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
