						["subeventSuffix"] = "_CAST_START",
						["check"] = "update",
						["custom"] = "function()\n    -- Refreshing Jade Wind target counter - desaturate mod\n    -- Original code by Clebane. Modified by Garg & Raysere\n    -- Based off Raysere's Essence Font target counter\n    \n    -- Number of injured targets in range before aura will show in colour\n    aura_env.target_threshold = 6 \n    \n    --When the number of injured targets drops below this number, the aura will desaturate (turn grey)\n    aura_env.untrigger_threshold = 6    \n    \n    aura_env.rangecheck =  aura_env.rangecheck or GetTime()\n    \n    --Only run if it's been > 1 second since the last time we ran\n    if GetTime() - aura_env.rangecheck > 1 then\n        \n        aura_env.rangecheck = GetTime()\n        \n        if IsInGroup() then\n            \n            aura_env.rangecheckcount = 0\n            \n            local grouptype = (IsInRaid() and 'raid') or (IsInGroup() and 'party')\n            \n            --Check if player should be counted as viable target\n            --Doing this separately because of awkward difference between party and raid UIDs\n            if UnitHealth('player') < UnitHealthMax('player') then\n                aura_env.rangecheckcount = aura_env.rangecheckcount +1\n            end\n            \n            --Iterate over group members, check their range, make sure they are not the player, then check if injured and increment count if so.\n            for i = 1,GetNumGroupMembers() do\n                \n                local inRange = IsItemInRange(33278,grouptype..i)\n                \n                if not UnitIsUnit(grouptype..i, 'player') and inRange then\n                    \n                    if UnitHealth(grouptype..i) < UnitHealthMax(grouptype..i) then\n                        \n                        aura_env.rangecheckcount = aura_env.rangecheckcount + 1\n                        \n                        \n                    end\n                end\n            end\n            \n            if aura_env.rangecheckcount >= aura_env.target_threshold then\n                WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(false)\n            end\n            \n            --Always show icon while in group\n            return true\n            \n        end\n    end\n    \n    \n    \nend",
						["event"] = "Health",
						["custom_hide"] = "timed",
					},
					["untrigger"] = {
						["custom"] = "function()    \n    \n    if (aura_env.rangecheckcount or 0)  < aura_env.untrigger_threshold then\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(true)\n    end\n    \nend",
