		["BaD - Mekkatorque - Crash Down"] = {
			["textFlags"] = "None",
			["stacksSize"] = 43,
			["xOffset"] = 0,
			["stacksFlags"] = "None",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["borderColor"] = {
				1, -- [1]
